import React from "react";

const PokemonMovesCard = ({
  pokemonData,
  currentSelectedPokemon,
  formatText,
}) => {
  console.log(pokemonData[currentSelectedPokemon]);
  return (
    <>
      {pokemonData[currentSelectedPokemon].moves.map(({ move }) => (
        <div>
          <p>{formatText(move.name)}</p>
          <p></p>
        </div>
      ))}
    </>
  );
};

export default PokemonMovesCard;
